// src/App.js

import React, { Component } from 'react';

class App extends Component {

  state = {
    locales: []
  }

  componentDidMount() {
    fetch('http://localhost:9999/api/v1/locales')
    .then(res => res.json())
    .then((data) => {
        this.setSate({ locales: data })
    })
    .catch(console.log)
  }

  render() {
    return (
      <div class="card">
        <div class="card-body">
          <h5 class="card-title">Steve Jobs</h5>
          <h6 class="card-subtitle mb-2 text-muted">steve@apple.com</h6>
          <p class="card-text">Stay Hungry, Stay Foolish</p>
        </div>
      </div>
    );
  }
}

export default App;
